// Import images
import biryani from './biryani.jpg';
import bbq from './bbq.jpg';
import malaiBoti from './malai boti.jpg';
import daalMakhni from './daal makhni.jpg';
import daal from './daal.jpg';
import pakakGosht from './pakak gosht.jpg';
import burger from './burger.jpg';
import shawarma from './shawarma.jpg';
import pizza from '.e/pizza.jpg';
import chickenKarahi from './chicken karahi.jpg';
import fish from './fish.jpg';
import haleem from './haleem.jpg';
import plainRice from './plain rice.jpg';
import chickenAchariHandi from './chicken achari handi.jpg';

// Define the Pakistani cuisine array
const pakistaniCuisine = [
    { id: 1, name: "Biryani", picture: biryani },
    { id: 2, name: "BBQ", picture: bbq },
    { id: 3, name: "Malai Boti", picture: malaiBoti },
    { id: 4, name: "Daal Makhni", picture: daalMakhni },
    { id: 5, name: "Daal", picture: daal },
    { id: 6, name: "Pakak Gosht", picture: pakakGosht },
    { id: 7, name: "Burger", picture: burger },
    { id: 8, name: "Shawarma", picture: shawarma },
    { id: 9, name: "Pizza", picture: pizza },
    { id: 10, name: "Chicken Karahi", picture: chickenKarahi },
    { id: 11, name: "Fish", picture: fish },
    { id: 12, name: "Haleem", picture: haleem },
    { id: 13, name: "Plain Rice", picture: plainRice },
    { id: 14, name: "Chicken Achari Handi", picture: chickenAchariHandi }
];

// Export the Pakistani cuisine array
export default pakistaniCuisine;
